import InnerNav from "../NavBar/InnerNav";

function ConsolePage() {
  return (
    <div className="grid">
      <InnerNav />
      <div id="Console">
        <h1>Welcome to Phone Phlinger</h1>
      </div>
    </div>
  );
}

export default ConsolePage;
